import React, { useEffect, useState } from 'react';

function Tickets () {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);

    useEffect(() => {
        fetch("file:///home/smissuser21/React_Project/aviasales/avias/src/Components/ticketList.html")
        .then(res => res.json())
        .then((result) => {
            setIsLoaded(true);
            setItems(result);
        },
        (error) => {
            setIsLoaded(true);
            setError(error);
          }
        )
    }, [])

    if (error) {
        return <div>Ошибка: {error.massage}</div>;
    } else if (!isLoaded) {
        return <div>Загрузка...</div>;
    } else {
        return (
            <ul>
                {items.map(item => (
                    <li key={item.price}>
                        {item.origin_name}
                        {item.destination_name}
                        {item.departure_date}
                        {item.arrival_date}
                        {item.departure_time}
                        {item.arrival_time}
                        {item.price}
                        {item.stops}  
                    </li>
                ))}
            </ul>
        )
    }

}

export default Tickets;
